import React from "react";
import { NavLink, Switch, Route } from 'react-router-dom';
import logo from "../images/deco-logo-white.png";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";

function Header() {
    return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <img className="logo" src={logo} alt="deco-logo" />
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
        <Nav>
        <NavLink exact to='/login'>Login</NavLink>
        <NavLink exact to='/option'>Option</NavLink>
        <NavLink exact to='/lookup'>Lookup</NavLink>
        {/* <NavLink exact to='/info'>Info</NavLink> */}
        {/* <NavLink exact to='/payment'>Payment</NavLink> */}
        </Nav>
        </Navbar.Collapse>
    </Navbar>
    )
}

export default Header;
